import React from "react";
import {BrowserRouter as Router} from 'react-router-dom';
import "./assets/styles/global.css";
import AppProvider from './hooks';
import Routes from "./routes";

const App: React.FC = () => (
  <Router>
    <AppProvider>
      <Routes/>
    </AppProvider>
  </Router>

)
export default App;
